import React from 'react'

export default function Filters(props) {

    const {
        tagSelected
    } = props;

    return (
        <div className="page-filters">
            <input onChange={tagSelected} type="radio" id="tag-all" value="all" name="game-tags" checked />
            <label for="tag-all" className="tag-label"><span className="icon-all"></span><p>All</p></label>
            <input onChange={tagSelected} type="radio" id="tag-new" value="new" name="game-tags" />
            <label for="tag-new" className="tag-label"><span className="icon-new"></span><p>New</p></label>
            <input onChange={tagSelected} type="radio" id="tag-top" value="top" name="game-tags" />
            <label for="tag-top" className="tag-label"><span className="icon-top"></span><p>Top</p></label>
        </div>
    )
}
